 { t:61522, s:0x91, n:0x3c, v:0x40 },
 { t:61522, s:0x82, n:0x38, v:0x31 },
 { t:61522, s:0x92, n:0x39, v:0x40 },
 { t:61822, s:0x80, n:0x3f, v:0x3b },
 { t:61822, s:0x90, n:0x40, v:0x40 },
 { t:61822, s:0x81, n:0x3c, v:0x49 },
 { t:61822, s:0x91, n:0x3b, v:0x40 },
 { t:61822, s:0x82, n:0x39, v:0x42 },
 { t:61822, s:0x82, n:0x2d, v:0x44 },
 { t:61822, s:0x92, n:0x28, v:0x40 },
 { t:61822, s:0x92, n:0x38, v:0x40 },
 { t:65422, s:0x80, n:0x40, v:0x48 },
 { t:65422, s:0x81, n:0x3b, v:0x49 },
 { t:65422, s:0x82, n:0x38, v:0x4c },
 { t:65422, s:0x82, n:0x28, v:0x45 },
 { t:65422, s:0x9a, n:0x22, v:0x01 },
 { t:67422, s:0x8a, n:0x22, v:0x01 },
]]

    var note_min = 0x20;
    var note_max = 0x60;
    var canvas = document.querySelector('canvas');
    var ctx = canvas.getContext('2d');
    var dpx = 1, dpy = 1, dpr = 1;
    var gravity = 9.8;

    function failaudio() { soundon = false; }
    function startaudio() { soundon = true; }

    var context=null;	// the Web Audio "context" object
    var mastervol=null;
    var voice = [];     // tracking of synth voices
    var attack=0.01;	// attack speed
    var decay=0.1;	// decay speed
    var sustain=0.1;    // sustain level
    var release=0.1;	// release speed
    var mastertune=440;
    var maxVoices=16;
    var waveform = 'sine';
    var soundon = false;

    function resumeAudio(event) {
      if (!context)
        return false;
      if (context.state == 'suspended') {
          // resume audio context on user interaction
          context.resume().then(startaudio,failaudio);
        } else
          return false; // prevent dismiss/submit
    }

    function findNote(note) {
      for (i = 0; i < maxVoices; i++) {
        if (voice[i].note == note)
          return i;
      }
      return 0;
    }

    var steal = 0;
    function nextNote(note) {
      var reuse = -1;
      var oldest = -1;
      for (var i = 0; i < maxVoices; i++) {
        if (voice[i].note == note) {
          if (reuse < 0 ||
            (reuse >= 0 && voice[i].start < voice[reuse].start))
            reuse = i;  // prefer oldest reuse
        }
        if (voice[i].note < 0) {
          if (oldest < 0)
            oldest = i;
          if (voice[i].start < voice[oldest].start)
            oldest = i;
        }
      }
      // if oldest note is in use, prefer to reuse existing same note
      if (oldest < 0 && reuse >= 0)
        return reuse;
      if (oldest < 0) {  // no unused voice, none match current note
        oldest = steal;
        steal += 1;  // round-robin which voice is stolen
        steal %= maxVoices;
      }
      return oldest;
    }

    function noteFreq(note) {
      return mastertune * Math.pow(2,(note-69)/12);
    }

    function startNote(channel, note, velocity) {
      var i = nextNote(note);
      voice[i].note = note;
      voice[i].freq = noteFreq(note);
      voice[i].hold1 = false;
      voice[i].sostenuto = false;
      voice[i].osc.frequency.setValueAtTime(voice[i].freq, 0);
      voice[i].osc.type = waveform;
      if (voice[i].start < 0)
        voice[i].osc.start();
      voice[i].start = context.currentTime;
      voice[i].env.gain.cancelScheduledValues(0);
      voice[i].env.gain.setTargetAtTime((velocity/127), 0, attack);
      voice[i].env.gain.setTargetAtTime((sustain * velocity/127),
        context.currentTime + attack, decay);
      // 9 to 3.3 seconds of sustain to decay to -60dB
      var sustime = 9 * Math.exp(-note/128);
      sustime = (sustime * 2) / 10;  // convert to time constant
      voice[i].env.gain.setTargetAtTime(0.001 / 127,
        context.currentTime + attack + decay, sustime); 
    }

    function stopNote(channel, note) {
      var i = findNote(note);
      if (i >= 0) {
        voice[i].env.gain.cancelScheduledValues(0);
        voice[i].env.gain.setTargetAtTime(0.0, 0, release);
      }
    }
    function killNotes() {
      for (var i = 0; i < maxVoices; i++) {
        voice[i].env.gain.cancelScheduledValues(0);
        voice[i].env.gain.setTargetAtTime(0.0, 0, release);
      }
    }

    function dbRatio(dB) {
      if (dB < 0)
        return Math.pow(10, dB / 20);
      return 1.0-Math.pow(10, -dB / 20);
    }

    function initaudio(event) {
      // patch up prefixes
      window.AudioContext=window.AudioContext||window.webkitAudioContext;
      context = new AudioContext();

      mastervol = context.createGain();
      mastervol.connect(context.destination);
      mastervol.gain.value = dbRatio(-10);
      for (var i = 0; i < maxVoices; i++) {
        // set up the basic oscillator chain, muted to begin with.
        var oscillator = context.createOscillator();
        var envelope = context.createGain();
        oscillator.frequency.value = 0;
        oscillator.connect(envelope);
        envelope.connect(mastervol);
        envelope.gain.value = 0.0;  // Mute the sound
        voice.push({
          start: -1,
          note: -1,
          freq: 0,
          osc: oscillator,
          env: envelope,
        });
      }
    }

    function resizeCanvas() {
      ctx.resetTransform();
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
      dpx = canvas.width / 100;
      dpy = canvas.height / (note_max - note_min);
      if (dpx <= 0) dpx = 1;
      if (dpy <= 0) dpy = 1;
      dpr = dpx/dpy;
      ctx.scale(dpx, dpy);
    }
    resizeCanvas();
    initaudio();
    window.addEventListener('resize', resizeCanvas);

    var ccolor = [];
    function hexrgb(r,g,b) {
      return "#" + ("0" + r.toString(16)).slice(-2) +
        ("0" + g.toString(16)).slice(-2) +
        ("0" + b.toString(16)).slice(-2);
    }
    // try to make 16 visually distinct colors, no black, no white
    function makeccolor() {
      var c = 0;
      ccolor = [];
      // make default color table
      for (var i = 1; c < 16; i++) {
        if ((i & 7) == 0 || (i & 7) == 7)
          continue; // skip black and white
        var b3 = (i & 8) ? 63 : 0;
        var b4 = (i & 16) ? 127 : 0;
        var r = (i & 1) ? 255 - b4 : b3; 
        var g = (i & 2) ? 255 - b3 - b4 : (i & 16) ? 63 : 0;
        var b = (i & 4) ? 255 - b3 - b4 : (i & 16) ? 63 : 0;
        var color = hexrgb(r,g,b);
        ccolor.push(color);
        c++;
      }
    }
    makeccolor();
    var noteboxes = [];

    function NoteBox(ch, note, vel) {
      this.c = ch;
      this.cc = 0;
      this.b = 0;
      this.n = note;
      this.v = vel;
      this.playing = true;
      this.w = 1;
      this.h = 1;
      this.dx = -20;
      this.dy = 0;
      this.x = 99;
      this.y = (note_max-note);
      this.boing = 0;

      this.update = function(dt) {
        this.x += this.dx * dt;
        this.y += this.dy * dt;
        if (this.dy || !playing) {
          this.dx *= Math.pow(0.9, dt);
          this.dy += gravity * dt;
        }
        if (this.playing) {
          this.w += -this.dx * dt;
          if (this.w > canvas.width) {
            // clip wide notes to viewing area
            this.w = 100;
            this.x = 0;
          }
          this.playing = playing;
        }
        if (this.cc) {
          this.cc += 8 * dt;
        }
        if (this.boing > 0) {
          this.boing -= dt;
          if (this.boing <= 0) {
            this.boing = 0;
            stopNote(this.c, this.n + 12 * this.b);
          }
        }
        ctx.fillStyle = ccolor[(this.c + Math.floor(this.cc)) & 0xf] +
                        (88 + this.v).toString(16);
        ctx.beginPath();
        ctx.ellipse(this.x, this.y + 0.5, 0.5 / dpr, 0.5, 0,
                    0.5 * Math.PI, 1.5 * Math.PI);
        ctx.ellipse(this.x + this.w, this.y + 0.5, 0.5 / dpr, 0.5, 0,
                    1.5 * Math.PI, 0.5 * Math.PI);
        ctx.fill();
      }
      this.bounce = function() {
        if (!soundon || this.boing) return;
        this.b += 1;
        this.cc += 1;
        score += this.b;
        if (this.n + 12 * this.b < 0x7f) {
          // make sound of note being hit..
          this.v *= 0.5;
          startNote(this.c, this.n + 12 * this.b, this.v);
          this.boing = 0.125;
        }
      }
    }

    function noteOff(ch, note) {
      for (var i = 0, j = noteboxes.length; i < j; i++) {
        if (noteboxes[i].n == note && noteboxes[i].c == ch)
          noteboxes[i].playing = false;
      }
      if (soundon) {
        stopNote(ch, note);
      }
    }
    function noteOn(ch, note, vel) {
      if (!vel) {
        noteOff(ch, note, 64);
        return;
      }
      noteboxes.push(new NoteBox(ch, note, vel));
      if (soundon) {
        startNote(ch, note, vel);
      }
    }
    function Dot() {
      this.x = 50;
      this.y = 1;
      this.dx = 0;
      this.dy = 0;
      this.c = false;
      this.update = function(dt) {
        this.x += this.dx * dt;
        this.y += this.dy * dt;
        this.dy += gravity * dt;
        this.dx *= Math.pow(0.9, dt);
        if (this.x > 99) {
          this.dx = -this.dx;
          this.x = 99;
        }
        if (this.y < 0) {
          this.dy = 0;
          this.y = 0;
        }
        if (this.x < 0 || this.y > note_max - note_min - 1) {
          resetLevel(true);
        }
        var r = 0.5 / dpr;
        this.c = false;  // for result of tests below
        for (var i = 0, j = noteboxes.length; i < j; i++) {
          if ((this.y > noteboxes[i].y + noteboxes[i].h + 0.5) ||
            (this.y < noteboxes[i].y - 0.5) ||
            (this.x < noteboxes[i].x - r) ||
            (this.x > noteboxes[i].x + noteboxes[i].w + r))
            continue;  // clearly out of bounds
          this.c = true;  // hit something
          noteboxes[i].bounce();  // update color and make sound
          // impact with sphere aligned with ball within platform extents
          var yc = noteboxes[i].y + 0.5;
          var xc = this.x;
          if (xc < noteboxes[i].x || xc > noteboxes[i].x + noteboxes[i].w) {
            xc = noteboxes[i].x;
          }
          // distance between two centers
          var d = Math.sqrt((xc-this.x)*(xc-this.x)+(yc-this.y)*(yc-this.y));
          if (d <= 0)
            d = 1;
          // normal
          var nx = (xc - this.x)/d;
          var ny = (yc - this.y)/d;
          // diff velocities
          var kx = this.dx - noteboxes[i].dx;
          var ky = this.dy - noteboxes[i].dy;
          var m2 = noteboxes[i].w + 1;  // ball=1, notebox=m2
          var p = 2 * (nx * kx + ny * ky) / (1 + m2);
          // update velocities
          this.dx -= (p * m2 * nx) * 1;
          this.dy -= (p * m2 * ny) * 1;
          noteboxes[i].dx += (p * 1 * nx) * 1;
          noteboxes[i].dy += (p * 1 * ny) * 1;
          var co = d - 0.5 - r;
          if (co < 0 && d > 0) { // handle static overlap
            var oy = this.y;
            this.x -= co * (this.x - xc) / d;
            this.y -= co * (this.y - yc) / d;
          }
        }
        ctx.fillStyle = '#fff';
        ctx.beginPath();
        ctx.ellipse(this.x, this.y, r, 0.5, 0, 0, 360);
        ctx.fill();
      }
      this.jump = function() {
        // if currently touching something
        this.dy = -gravity;
      }
      this.down = function() {
        // if currently touching something
        this.dy = gravity;
      }
      this.right = function() {
        // if currently touching something
        this.dx = 10;
      }
      this.left = function() {
        // if currently touching something
        this.dx = -22;
      }
    }

    var start = -1;
    var lasttime = 0;
    var level = 0;
    var score = 0;
    var highscore = 2368;  // good luck with the game!
    var difficulty = 1000;  // ticks per second
    var index;
    var playing;
    var player;

    function kbdEvent(event) {
      if (!soundon) resumeAudio(event);
      soundon = playing = true;
      if (event.code == 'ArrowLeft' ||
          event.code == 'KeyA' ||
          event.code == 'KeyH') {
        player.left();
      }
      if (event.code == 'ArrowRight' ||
          event.code == 'KeyD' || 
          event.code == 'KeyL') {
        player.right();
      }
      if (event.code == 'Space' ||
          event.code == 'KeyW' ||
          event.code == 'KeyK' ||
          event.code == 'ArrowUp') {
        player.jump();
      }
      if (event.code == 'ShiftLeft' ||
          event.code == 'KeyS' ||
          event.code == 'KeyJ' ||
          event.code == 'ArrowDown') {
        player.down();
      }
      if (event.code == 'Escape') {
        // pause/repeat level
        resetLevel(false);
      }
    }
    function mouseEvent(event) {
      if (!soundon) resumeAudio(event);
      soundon = playing = true;
      player.jump();
    }
    function resetLevel(endgame) {
        killNotes();
        player = new Dot();
        index = 0;
        playing = false;
        if (endgame) {
          score = 0;
          level = 0;
        }
    }
    resetLevel(true);
    var theta = 0;
    function animate(timestamp) {
	ctx.clearRect(0, 0, canvas.width, canvas.height);
	var dt = (timestamp - lasttime) / 1000;
	lasttime = timestamp;
	if (!playing) {
	    start = timestamp;
        }
	var runtime = (timestamp - start) / 1000;
        var tick = runtime * difficulty;
        while (playing && tick >= lvl[level][index].t) {
          var e = lvl[level][index];
          var ch = e.s & 0x0f;
          if ((e.s & 0xf0) == 0x90) {
            noteOn(ch, e.n, e.v);
          } else { 
            noteOff(ch, e.n, e.v);
          }
          index++;
          if (index >= lvl[level].length) {
            level++;
            resetLevel(false);
            if (level > 8) {
              level = 0;
              // you win!
            }
          }
        }

        ctx.font = '5px Fredericka the Great';
        ctx.fillStyle = '#8ff';
        ctx.fillText(score, 5, 5);
        if (score > highscore)
          highscore = score;
        ctx.font = '2px Fredericka the Great';
        ctx.fillText(highscore, 88, 5);
        ctx.fillText("High Score", 88, 2.5);
        ctx.fillText("Bounce the ball to the end", 52, 2.5);
        ctx.fillText("of each song for next level...", 52, 5);

        ctx.fillText("WASD or HJKL or Arrows", 18, 2.5);
        ctx.fillText("Shift/Space to move", 18, 5);

        // draw noteboxes
        for (var i = 0, j = noteboxes.length; i < j; i++) {
          noteboxes[i].update(dt);
        }
        // delete noteboxes that scroll off screen
        for (var i = noteboxes.length - 1; i >= 0; i--) {
          if (noteboxes[i].x + noteboxes[i].w < 0 ||
              noteboxes[i].y > note_max - note_min) {
            noteboxes.splice(i, 1);
          }
        }
        if (playing) {
          player.update((runtime > 1 ? dt : 0));
          if (runtime < 1) {
            ctx.font = '10px Fredericka the Great';
            ctx.fillText((1 - runtime).toFixed(1), 41, 15);
          }
        } else {
          theta += dt * 6;
          if (theta > 2 * Math.PI) {
            theta -= 2 * Math.PI;
          }
          var sx = 0.01 * Math.sin(theta);
          player.update(0);
          ctx.font = (1 - sx) * 10 + 'px Fredericka the Great';
          ctx.fillText("Prelude " + (level + 1), (1 + sx) * 10, 20);
          ctx.font = (1 + sx) * 4 + 'px Fredericka the Great';
          ctx.fillText("Move to play...", (1 - sx) * 10, 25);
        }
	requestAnimationFrame(animate);
    }
    window.addEventListener('keydown', kbdEvent);
    canvas.addEventListener('mousedown', mouseEvent);
    requestAnimationFrame(animate);
 </script>
